function addToCart() {
  var item = curNameArray[specIndex];
  var quantity = quant;
  var totalCalorie = quant * curCalArray[specIndex];
  var td_item = document.createElement("td");
  var text_id = document.createTextNode(item);
  td_item.appendChild(text_id);

  var td_quant = document.createElement("td");
  var text_id2 = document.createTextNode(quantity);
  td_quant.appendChild(text_id2);

  var td_cal = document.createElement("td");
  var text_id3 = document.createTextNode(totalCalorie);
  td_cal.appendChild(text_id3);
  console.log("eare");
  var td_a = document.createElement("td");
  var ele_a = document.createElement("a");
  ele_a.setAttribute("href", "javascript:void(0);");
  ele_a.setAttribute("onclick", "del(this);");
  var text_a = document.createTextNode("Delete");
  ele_a.appendChild(text_a);
  td_a.appendChild(ele_a);

  var tr = document.createElement("tr");
  tr.appendChild(td_item);
  tr.appendChild(td_quant);
  tr.appendChild(td_cal);
  tr.appendChild(td_a);

  var table = document.getElementsByTagName("table")[0];
  table.appendChild(tr);
  updateCal();
}

function del(object) {
  var table = object.parentNode.parentNode.parentNode;
  var tr = object.parentNode.parentNode;
  Cal -= tr.cells[2].innerHTML;
  table.removeChild(tr);
  updateCal();
}

function updateCal() {
  var text = document.getElementById("totalCal");
  text.innerHTML = "Total Calories: " + Cal;
  var value = localStorage.getItem("value");
  var text2 = document.getElementById("Calorie Defficiency");
  if (value - Cal > 0) {
    text2.innerHTML = "Calorie Needed: " + Math.trunc(value - Cal);
  }
  if (value == Cal) {
    text2.innerHTML = "Enough Calorie reached";
  }
  if (value - Cal < 0) {
    text2.innerHTML = "Calorie excess: " + Math.trunc(-value + Cal);
  }
}

function setUpTab() {
  document.querySelectorAll(".tabs__content").forEach(button => {
    button.addEventListener("click", () => {
      const sideBar = button.parentElement;
      const tabContainer = sideBar.parentElement;
      const tabNumber = button.dataset.forTab;
      const tabsToActivate = tabsContainer.querySelectorAll('.tab__content[data-tab= "${tabNumber}"]')
    })
  })
}